                    if (defaultLabel[(labelAvail * 14) + 13] == 0xffffff) {
                        label.setFontColor(0xffffff);
                    }
                    label.setOrigin(0.5, 0.5);
                    label.setDepth(objectsDataImport[(i * 9 + 5) + objectsDataImport[2]])
