function isHexValid(value) {
    if (value == "") {
        return false;
    }
    if (value.length < 6) {
        return false;
    }
    var p = 0;
    var re1 = /(\n|\r)+/g;
    var re2 = /[\Wg-zG-Z]/;
    var re3 = /v/i;

    var s = arguments[0];
    if (typeof s != "string") {
        s = s.toString();
    }

    var opt = arguments[1];
    if (re3.test(opt) && (s.length % 2 > 0)) {
        return false;
    }

    s.replace(re1, "");

    if (s.substr(0, 1) == "#") {
        p = 1;
        value = value.substr(1);
        return value;
    } else if (s.substr(0, 2).toLowerCase() == "0x") {
        p = 2;
        value = value.substr(2);
        return value;
    }

    if (re2.test(s.substr(p, s.length))) {
        return false;
    }
    return value;
}